import { Modal } from "react-native-ui-lib";

export default function WinModal({onClick, modalVisible}) {
    return (
        <Modal
            animationType="slide"
            transparent={true}
            visible={modalVisible}
            onRequestClose={() => {
            onClick();
            }}
        >
            asdasdasd
            </Modal>
    );
}
